import './App.css';
import { Routes, Route, Link } from "react-router-dom";
import Footer from './components/Footer';
import Header from './components/Header';

function App() {
  return <main>

  <Header/>
<Routes>
  <Route path = "/" element= {"Home"}></Route>
</Routes>
  <Footer/>

  </main>;
}

export default App;
